import './App.css';


const App = () => {
    return (
      <div className='app-wrapper'>
          <header>
            <img src='https://media.istockphoto.com/vectors/adoption-and-community-care-vector-id1286680331?k=20&m=1286680331&s=612x612&w=0&h=N7cQExSqTTo-Jd30iyOe0IrCCpbeyCRBuxUHL1j13qs='></img>
          </header>
          <nav>
            <div>
              Profile
            </div>
          </nav>
          <div>
            Main content
          </div>

      </div>
    );
  }

export default App;
